import React from 'react'

function NavListItem({ nav, onClick  }) {

    const handleClick = () => {
        // Call onClick function passed from parent component
        onClick();
    };
    return (
        <li>
            <a href={nav.link}>{nav.name} </a>
        </li>
    )
}

export default NavListItem
